create table match
(
    n4_id          integer generated by default as identity
        primary key,
    n4_round       integer not null,
    n4_fthg        integer not null,
    n4_ftag        integer not null,
    str_date       varchar(50),
    n4_external_id integer,
    n4_away_id     integer not null
        constraint match_n4_away_id_81710dc3_fk_team_attendance_n4_id
            references team_attendance
            deferrable initially deferred,
    n4_home_id     integer not null
        constraint match_n4_home_id_b75e7e5c_fk_team_attendance_n4_id
            references team_attendance
            deferrable initially deferred,
    n4_league_id   integer not null
        constraint match_n4_league_id_7a961dec_fk_league_n4_id
            references league
            deferrable initially deferred
);

alter table match
    owner to pldjango;

create index match_n4_away_id_81710dc3
    on match (n4_away_id);

create index match_n4_home_id_b75e7e5c
    on match (n4_home_id);

create index match_n4_league_id_7a961dec
    on match (n4_league_id);

